'use strict';
const printImmutable = require('./lib/printImmutable');
const IS_SET = '@@__IMMUTABLE_SET__@@';
const IS_ORDERED = '@@__IMMUTABLE_ORDERED__@@';
const test = (maybeSet) => !!(maybeSet && maybeSet[IS_SET] && !maybeSet[IS_ORDERED]);
const print = (val, print, indent, opts, colors) => printImmutable(val, print, indent, opts, colors, 'Set', false);
module.exports = {
  print,
  test
};
